import React from 'react';
import './Button.css';

export default props => {
    let classes = 'button '
    classes += props.operation ? 'operation' : '';
    classes += props.double ? 'double' : '';
    classes += props.triple ? 'triple' : '';

    <button className ={`
        button
        ${props.operation ? 'operation': ''}
        ${props.double ? 'double' : ''}
        ${props.triple ? 'triple' : ''}
    `}>
        {props.label}
    </button>
    }
